{'es-ES': 'Vivienda unifamiliar adosada situada en el municipio de Coreses, provincia de Zamora.

La vivienda tiene una superficie construida de 161 m², edificada sobre una parcela de 174 m², y se distribuye en cocina, recibidor, salón-comedor, baño, aseo, tres dormitorios, hall y patio. 

El inmueble se encuentra en una zona tranquila, rodeado por viviendas residenciales de similares características. Cuenta con fácil acceso a la carretera y otros nudos de comunicación. Cercano a establecimientos y comercios de la zona.'}

