{'es-ES': 'Espectacular casa de pueblo en el centro de Alcañices, vivienda reformada prácticamente en su totalidad hace menos de 10 años, cuenta con 6 habitaciones (1 de matrimonio en la planta baja, 3 de matrimonio   1 individual con 3 camas   1 individual de 2 camas en la planta de arriba), 2 baños completos (1 en la planta baja y otro en la planta de arriba), 2 salones en la planta baja   1 despensa   1 cobertizo interior. En la planta superior tenemos otro recibidor con un enorme tragaluz.

Se vende junto a un enorme huerto (1000m2) a menos de 1 km de la vivienda que cuenta con entrada para vehículos, garaje de chapa, una pequeña habitación, cocina, piscina desmontable y un enorme huerto con el río al lado.

Precio negociable.'}

{'es-ES': '-Precioso ático de dos dormitorios, un cuarto de baño, un aseo con plato de ducha, salón comedor y una estupenda TERRAZA de 43m2.

